import {useNavigate} from 'react-router-dom';

class Header extends Component {    

    handleClickButton = () => {
        const navigate = useNavigate();
        navigate('/');
    }

    render() {
        return (
            <button onClick={this.handleClickButton}>Basd</button>
        )
    }

}
export default Header
